import React from "react";
import bg0 from "../../../media/bg-0.jpg";

const Landing = (props) => {
  return (
    <div
      style={{
        height: "100vh",
        marginTop: "45px",
        backgroundColor: "rgba(255,0,0,0.1)",
      }}
    >
      Landing
      <div className="col-2">
        <img alt="bg-0" src={bg0} class="rounded float-left"></img>
      </div>
    </div>
  );
};

export default Landing;
